import React from 'react';
import './App.css';
import {Link} from 'react-router-dom';

function Projects() {
    return ( 
        <div>
            <div className="projectsrow">
                <div className="projectslink">
                <h1>My Github:</h1>
                <b>https://github.com/Chittoji-Murali-Sree-Krishna</b>
                </div>
                <div className="projectscol">
                    <h2>Project's i have done</h2>
                    <select name="Projects" className='projectselect'>
                        <option value=""></option>
                        <option value="python">Python</option>
                    </select>
                </div>
            </div>
         </div>
    );
}

export default Projects;
